import React from 'react'
import {Navbar,NavDropdown,FormControl,Form,Nav,Button  } from 'react-bootstrap';
import './search.style.scss';

const Search = () => {
    return (
           
       <div>
         
            <Form inline>
      <FormControl type="text" placeholder="Search" className="mr-sm-12"/>
      <Button variant="outline-danger" style={{color : 'red'}}>Search</Button>
    </Form>

        </div>
    )
}

export default Search
